description:
Deze unieke belevenis bevat:
- Gepersonaliseerde belevenisbon;
- Korte instructie door een professionele instructeur;
- 20 minuten zelf rijden in een Ferrari 348 TS;
- Na afloop krijg je een klein aandenken mee naar huis.

Was het altijd al jouw droom om op het gaspedaal van deze legendarische sportwagen te drukken? Dan past deze onvergetelijke belevenis beslist bij jou.

Met een instructeur aan je zijde rijd je langs een leuke route over de openbare weg. Geen eentonige weggetjes, maar een variërende route, zodat je de mogelijkheden van de wagen helemaal zelf kunt ontdekken. Het is aan jou om het Italiaanse temperament van de rode bolide te bedwingen!

Kortom: gun jezelf of iemand anders deze onvergetelijke Ferrari 348 TS belevenis!

Deze belevenis wordt aangeboden in de volgende plaatsen:
Vleuten (Utrecht), Hilversum (Noord-Holland), Amersfoort (Utrecht), Breda (Noord-Brabant), Roosendaal (Noord-Brabant), Zoetermeer (Zuid-Holland), Zandvoort (Noord-Holland), Alkmaar (Noord-Holland), Zwolle (Overijssel), Teuge (Gelderland), Den Bosch (Noord-Brabant), Cuijk (Noord-Brabant), Venlo (Limburg) en Aachen (Duitsland).

 Deze unieke belevenis voor twee personen bevat:
- Gepersonaliseerde belevenisbon; 
- Een avondcruise door het romantische Haarlem;
- 2 drankjes; 
- Diverse hapjes.

Jullie gaan anderhalf uur varen door het fraai verlichte, historische centrum van Haarlem onder het genot van een lekker drankje, hapje en kaarslicht. Het uitzicht is fantastisch en maakt de avondrondvaart door de romantische stad helemaal compleet!

De historische binnenstad van Haarlem wordt gekenmerkt door vele oude straatjes en monumenten. De stad is omringd door grachten en singels waar jullie doorheen gaan varen. Vanaf het water is goed te zien hoe de verschillende gebouwen uit de 16e, 17e, 18e en 19e eeuw naast elkaar pronken. Met karakteristieke gevels en uiteenlopende vormen is ieder gebouw uniek. 

Kortom: een superromantische belevenis voor twee personen!

Let op:
- De afvaart is iedere vrijdag en zaterdag om 17.30 in Haarlem
